import React from "react";

import Icon from "../Cart/Icon";

const CartButton = () => {
  return (
    <div>
      <button>
        <span className={classes.icon}>
          <Icon />
        </span>
        <span>Your Cart</span>
        <span className={classes.badge}>2</span>
      </button>
    </div>
  );
};

export default CartButton;
